// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

contract Leader{

    uint256 turnNumber = 0;
    uint256 maxCandidateNumber = 10;
    bool isVotingOn;
    bool isRecommendationOn;
    uint256 totalStake;
    address messageRouter;

    struct Vote{
        address miner;
        uint256 slotNumber;
    }
    struct Candidate{
        string value;
        address recommender;
        uint256 totalVote;
    }
    struct Miners{
        address minerAddress;
        uint256 stakeAmount;
    }
    Miners[] miners;
    //key represents turn number
    mapping(uint256=>Vote[]) votesOfTurns;
    mapping(uint256=>Candidate[]) topicsForVote;
    mapping(uint256=>Candidate[]) candidates;

    constructor(address _messageRouter){
        totalStake = 0;
        messageRouter = _messageRouter;
    }

    modifier onlyMiner(){
        bool flag = false;
        for (uint index=0; index<miners.length;index++) 
        {
            if(miners[index].minerAddress==msg.sender){
                flag = true;
            }
        }
        require(flag,"This function is allowed for only mines");
        _;
    }

    modifier notCasted(){
        bool flag = true;
        for (uint index=0; index<votesOfTurns[turnNumber].length;index++) 
        {
            if(votesOfTurns[turnNumber][index].miner == msg.sender){
                flag = false;
            }
        }
        require(!flag,"You casted a vote before");
        _;
    }

    modifier lessThanMaxCandidate(){
        require(candidates[turnNumber].length<maxCandidateNumber,"No more candidate");
        _;
    }

    modifier cannotOfferMoreThanOne(){
        bool flag = false;
        for (uint256 index=0; index<candidates[turnNumber].length; index++) 
        {
            if(candidates[turnNumber][index].recommender == msg.sender){
                flag = true;
            }
        }
        require(!flag,"User made the recommendation before");
        _;
    }

    modifier votingOn(){
        require(isVotingOn,"Voting is not active");
        _;
    }

    modifier votingOff(){
        require(!isVotingOn,"Voting is active");
        _;
    }

    modifier recommendationOn(){
        require(isRecommendationOn,"Recommendation is not active");
        _;
    }

    modifier recommendationOff(){
        require(!isRecommendationOn,"Recommendation is active");
        _;
    }

    function startVoting() external votingOff{
        isVotingOn = true;
    }

    function finishVoting() external votingOn{
        isVotingOn = false;
        //TODO send result to message router
        startRecommendation();
    }

    function startRecommendation() private {
        turnNumber+=1;
        isRecommendationOn = true;
        chooseMinersForRecommendation();
    }

    function finishRecommendation() public {
        isRecommendationOn = false;
        Candidate[] memory topCandidates = getTopCandidates();
        for (uint256 index=0; index < topCandidates.length; index++) 
        {
            topicsForVote[turnNumber].push(topCandidates[index]);
        }
    }

    function castVote(uint256 slotNumber) public onlyMiner notCasted votingOn{
        votesOfTurns[turnNumber].push(Vote(msg.sender,slotNumber));
    }

    function addStake() external payable{
        for (uint256 index=0; index<miners.length; index++) 
        {
            if(msg.sender == miners[index].minerAddress){
                miners[index].stakeAmount += msg.value;
                totalStake += msg.value;
            }
        }
    }

    function getTopCandidates() public view returns (Candidate[] memory) {
        require(candidates[turnNumber].length >= maxCandidateNumber/2, "Not enough candidates");
        uint256 totalSelectedAmount = maxCandidateNumber/2;
        Candidate[] memory topCandidates = new Candidate[](totalSelectedAmount);
        uint256[] memory maxVotes = new uint256[](totalSelectedAmount);
        // Initialize maxVotes with the first totalSelectedAmount candidates' votes
        for (uint256 i = 0; i < totalSelectedAmount; i++) {
            topCandidates[i] = candidates[turnNumber][i];
            maxVotes[i] = candidates[turnNumber][i].totalVote;
        }

        for (uint256 index = totalSelectedAmount; index<candidates[turnNumber].length; index++) 
        {
            uint256 minIndex = 0;
            uint256 minValue = maxVotes[0];

            // Find the candidate with the lowest votes among the top 5
            for (uint256 j = 1; j < 5; j++) {
                if (maxVotes[j] < minValue) {
                    minValue = maxVotes[j];
                    minIndex = j;
                }
            }

            if (candidates[turnNumber][index].totalVote > minValue) {
                maxVotes[minIndex] = candidates[turnNumber][index].totalVote;
                topCandidates[minIndex] = candidates[turnNumber][index];
            }

        }
        return topCandidates;
    }

    function chooseMinersForRecommendation() private votingOff{
        address[] memory chosenMiners = selectRandomMiner();
        for (uint256 index; index<chosenMiners.length; index++) 
        {
            bytes memory payload = abi.encodeWithSignature("recommenderModeOn()");
            (bool success,) = chosenMiners[index].call(payload);
            require(success);
        }
    }

    function pseudoRandom() private view returns(uint256) {
        return uint256(keccak256(abi.encodePacked(block.timestamp, block.difficulty, msg.sender))) % maxCandidateNumber;
    }

    function recieveRecommender(string calldata value) external cannotOfferMoreThanOne lessThanMaxCandidate recommendationOn {
        candidates[turnNumber].push(Candidate(value,msg.sender,0));
    }

    function selectRandomMiner() public view returns(address[] memory) {
        uint256 randomValue = pseudoRandom();
        uint256 cumulativeProbability = 0;
        address[] memory selectedItems = new address[](miners.length);
        bool[] memory isItemChosen = new bool[](miners.length);
        for(uint256 i = 0; i < miners.length; i++) {
            if (isItemChosen[i]) {
                continue;
            }
            cumulativeProbability += miners[i].stakeAmount/totalStake;
            if(randomValue < cumulativeProbability) {
                selectedItems[i] = miners[i].minerAddress;
                isItemChosen[i] = true;
                break;
            }
        }
        return selectedItems;
    }

    function setMaximumCandidateNumber(uint256 _maxCandiateNumber) public recommendationOff{
        maxCandidateNumber = _maxCandiateNumber;
    }

    function getMaximumCandidateNumber() public view returns(uint256){
        return maxCandidateNumber;
    }

}

